// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/utils/Initializable.sol";

/**
 * @title the implementation of the AMM
 * @author Eric Nordelo
 */
contract PriviAMM is ERC20, Pausable, AccessControl, Initializable {
    // amm types
    bytes32 public constant QUADRATIC_AMM = keccak256("quadratic");
    bytes32 public constant LINEAR_AMM = keccak256("linear");

    address private _fundingTokenAddress;
    uint256 public fundingTokenPrice;
    uint256 public maxPrice;
    uint256 public maxSupply;
    bytes32 public ammType;
    uint256 public supplyReleased;
    uint256 public precision;

    uint256 public scale;

    // solhint-disable-next-line
    constructor() ERC20("Privi AMM Token", "pAMMT") {}

    /**
     * @notice set the default admin (can't be on construction time for minimal proxy clones functionality)
     * @param _fundingToken the address of the ERC20 token used for funding
     * @param _fundingTokenPrice the price of the ERC20 token used for funding
     * @param _maxPrice the max price used in formulas
     * @param _maxSupply the max supply used in formulas
     * @param _ammType the amm type
     * @param _precision precision value (loog for the README.md)
     */
    function initialize(
        address _fundingToken,
        uint256 _fundingTokenPrice,
        uint256 _maxPrice,
        uint256 _maxSupply,
        bytes32 _ammType,
        uint256 _precision
    ) external initializer {
        require(_maxPrice >= _fundingTokenPrice, "Invalid prices");
        require(_precision > 10000, "Invalid precision");
        require(_maxSupply > 0, "Invalid max supply");

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);

        _fundingTokenAddress = _fundingToken;
        fundingTokenPrice = _fundingTokenPrice;
        maxPrice = _maxPrice;
        maxSupply = _maxSupply;
        ammType = _ammType;
        precision = _precision;

        if (ammType == LINEAR_AMM) {
            scale = ((maxPrice - fundingTokenPrice) * _precision) / maxSupply;
        } else if (ammType == QUADRATIC_AMM) {
            scale = ((maxPrice - fundingTokenPrice) * _precision) / (maxSupply**2);
        } else {
            revert("Invalid amm type");
        }
    }

    function pause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _pause();
    }

    function unpause() public onlyRole(DEFAULT_ADMIN_ROLE) {
        _unpause();
    }

    /**
     * @notice allows the buying (minting) of amm tokens
     * @param _ammTokenAmount the amount of funding token to exchange
     * @param _buyer address of the buyer
     */
    function buyTokens(address _buyer, uint256 _ammTokenAmount) external {
        require(_ammTokenAmount > 0, "Invalid amount");
        require(supplyReleased + _ammTokenAmount <= maxSupply, "Not enough max supply");
        uint256 amountToPay = integral(_ammTokenAmount, true);

        supplyReleased += _ammTokenAmount;

        // make the transfers (should have the allowance)
        ERC20(_fundingTokenAddress).transferFrom(_buyer, address(this), amountToPay);
        _mint(_buyer, _ammTokenAmount);
    }

    /**
     * @notice allows the selling (burning) of amm tokens
     * @param _ammTokenAmount the amount of funding token to exchange
     * @param _seller address of the seller
     */
    function sellTokens(address _seller, uint256 _ammTokenAmount) external {
        require(_ammTokenAmount > 0, "Invalid amount");
        require(supplyReleased >= _ammTokenAmount, "Not enough liquidity");

        uint256 amountToPay = integral(_ammTokenAmount, false);

        supplyReleased -= _ammTokenAmount;

        // make the transfers
        _burn(_seller, _ammTokenAmount);
        ERC20(_fundingTokenAddress).transfer(_seller, amountToPay);
    }

    /**
     * @notice allows the buyer to check how much he has to approve
     * @param _ammTokenAmount the amount of funding token to exchange
     * @param _buying indicates the amount for buying or for selling
     */
    function getPriceForAmountOfTokens(uint256 _ammTokenAmount, bool _buying)
        external
        view
        returns (uint256 amountToPay)
    {
        require(_ammTokenAmount > 0, "Invalid amount");
        require(supplyReleased + _ammTokenAmount <= maxSupply, "Not enough max supply");
        amountToPay = integral(_ammTokenAmount, _buying);
    }

    function integral(uint256 _ammTokenAmount, bool buying) internal view returns (uint256 integralValue) {
        uint256 upperBound;
        uint256 lowerBound;
        uint256 shift = fundingTokenPrice;

        if (buying) {
            upperBound = supplyReleased + _ammTokenAmount;
            lowerBound = supplyReleased;
        } else {
            upperBound = supplyReleased;
            lowerBound = supplyReleased - _ammTokenAmount;
        }

        if (ammType == LINEAR_AMM) {
            uint256 term1 = saveSubstraction((upperBound)**2, lowerBound**2);
            uint256 term2 = saveSubstraction((upperBound), lowerBound);
            uint256 term3 = (term1 / 2) + term2;

            integralValue = (scale * (term3 / 2)) / precision + shift;
        } else if (ammType == QUADRATIC_AMM) {
            uint256 term1 = saveSubstraction((upperBound)**3, lowerBound**3);
            uint256 term2 = saveSubstraction((upperBound), lowerBound);
            uint256 term3 = (term1 / 3) + term2;

            integralValue = (scale * (term3 / 3)) / precision + shift;
        } else {
            revert("Invalid AMM Type");
        }
    }

    function saveSubstraction(uint256 _a, uint256 _b) internal pure returns (uint256) {
        require(_a >= _b, "Not enough balance");
        return _a - _b;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        super._beforeTokenTransfer(from, to, amount);
    }
}

